import Head from "next/head";
import Link from "next/link";
import { get } from "lodash/object";
import withAuthUser from "../utils/pageWrappers/withAuthUser";
import withAuthUserInfo from "../utils/pageWrappers/withAuthUserInfo";

export const siteTitle = "Drinks To You";

const Layout = ({ children, AuthUserInfo, home }) => {
  const AuthUser = get(AuthUserInfo, "AuthUser", null);
  return (
    <>
      <Head>
        <link rel="icon" href="/favicon.ico" />
        <link
          rel="apple-touch-icon"
          sizes="180x180"
          href="favicon/apple-touch-icon.png"
        />
        <link
          rel="icon"
          type="image/png"
          sizes="32x32"
          href="favicon/favicon-32x32.png"
        />
        <link
          rel="icon"
          type="image/png"
          sizes="16x16"
          href="favicon/favicon-16x16.png"
        />
        <link rel="manifest" href="/site.webmanifest" />
        <link
          rel="stylesheet"
          href="https://unpkg.com/purecss@2.0.3/build/pure-min.css"
          integrity="sha384-cg6SkqEOCV1NbJoCu11+bm0NvBRc8IYLRGXkmNrqUBfTjmMYwNKPWBTIKyw9mHNJ"
          crossOrigin="anonymous"
        ></link>
        <link
          rel="stylesheet"
          href="https://unpkg.com/purecss@2.0.3/build/grids-responsive-min.css"
        />
        <meta
          name="description"
          content="Cocktail delivery service using Next.js"
        />
      </Head>
      <div className="pure-menu pure-menu-horizontal">
        <a href="#" className="pure-menu-heading pure-menu-link">
          {siteTitle}
        </a>
        <ul className="pure-menu-list">
          <li className="pure-menu-item">
            <a href="#" className="pure-menu-link">
              Drinks
            </a>
          </li>
          <li className="pure-menu-item">
            <a href="#" className="pure-menu-link">
              Cart
            </a>
          </li>
          <li className="pure-menu-item">
            {!AuthUser ? (
              <Link href={"/auth"}>
                <a className="pure-menu-link">Sign in</a>
              </Link>
            ) : (
              <p>You're signed in. Email: {AuthUser.email}</p>
            )}
          </li>
        </ul>
      </div>
      <main>{children}</main>
    </>
  );
};

export default Layout;
